        <SideNavbar />

        {/* ini buat dashboard */}
        <div class='col-10'>
          <h2>Reports</h2>
          <p>Selamat datang di dashboard Anda!</p>
          {/* Tambahkan konten dashboard di sini */}
          <div className='dashboard-content'>
            {/* Konten Dashboard dapat ditambahkan di sini */}
            {/* <p>Ini adalah area konten dashboard.</p> */}


          </div>
        </div>
      </div>
    </div>
  );
}
